package main

import (
	"log"
	"net/http"
	"sync"
	"time"
)

type SafeMap struct {
	visited map[string]bool
	mux     sync.Mutex
}

// MarkVisited marks a URL as visited in a thread-safe manner.
func (m *SafeMap) MarkVisited(url string) bool {
	m.mux.Lock()
	defer m.mux.Unlock()
	if m.visited[url] {
		return false
	}
	m.visited[url] = true
	return true
}

// Crawl performs the crawling operation on a given URL.
func Crawl(url string, safeMap *SafeMap, wg *sync.WaitGroup) {
	defer wg.Done()
	if !safeMap.MarkVisited(url) {
		return // URL has already been visited
	}
	// Fetch the page
	resp, err := http.Get(url)
	if err != nil {
		log.Println("failed to get %s: %v", url, err)
		return
	}
	defer resp.Body.Close()

	if resp.StatusCode != http.StatusOK {
		log.Printf("Skipping non-HTML or non-200 OK URL %s", url)
		return
	} else {
		log.Printf("Found: %s", url)
	}

}
